import React from 'react';

const AddMember = () => {
	return (
			<div>
				<form action="">
					<div>
						<p>회원 이름</p>
						<input type="text"/>
					</div>
					<div>
						<p>나이</p>
					<input type="text"/>
					</div>
					<button >회원 추가</button>
				</form>
			</div>
	)
}
export default AddMember;
